  [],\n\t\"revision_timestamp\": \"2016-07-27T22:19:52.264711\",\n\t\"name\": \"balcones-canyonlands-national-wildlife-refuge-comprehensive-conservation-plan\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Balcones Canyonlands NWR for the next 15 years.
  This plan outlines the Refuge vision and purpose and describes how Balcones Canyonlands
  NWR will contribute to the overall mission of the Refuge System. The plan provides
  an introduction to the Refuge, an overview of the CCP process, legal mandates and
  guidelines, long-range management strategies, and management goals and objectives.
  Key planning issues include: watershed management, grassland management, forest
  management, and wildlife conservation.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
